    <title>Corona ZH</title>

<body>
<div class="topBar" id="topbar">
    <h1>Corona Map</h1>
    <div>
        <input class="slider" type="range" step="86400000" max="1595289600000" min="1594335363000" value="1594335363000" id="rangeControlledByDate" onchange="setup(); tablefunction(); labelfunction();" >
    </div>
</div>
<div class="row">
    <div class="column">
        <label id="datepickerlabel" for="dateControlledByRange">Datum wählen:</label>
        <input type="date" max="2021-12-31" min="2020-07-09" value="2020-07-09" id="dateControlledByRange" onchange="setup(); tablefunction(); labelfunction();"/>
        <div class="relationButtons">
            <input onchange="setup()" id="dichte" class="radiobutton" name="reason" type="radio" value="Fit Description">In Relation zur Bevölkerungsdichte<br>
            <input onchange="setup()" id="anzahlPop" class="radiobutton" name="reason" type="radio" value="Fit Description">In Relation zur Bevölkerungsanzhal (Pro 20'000 Einwohner)<br>
            <input onchange="setup()"class="radiobutton" name="reason" type="radio" value="Fit Description" checked="checked" >Ohne
            Filter<br>
        </div>
        <div class="row">
            <div class="column">
                <label for="vergleicheins" class="inputlabel">Vergleich PLZ 1:</label>
                <input id="vergleicheins" name="plzinput" type="text" value="" oninput="labelfunction()">
                <div class="boxed">
                    <div id="vergleich" >

                    </div>
                </div>
            </div>
            <div class="column">
                <label for="vergleichzwei" class="inputlabel">Vergleich PLZ 2:</label>
                <input id="vergleichzwei" name="plzinput" type="text" value="" oninput="labelfunction()">
                <div class="boxed">
                    <div id="vergleich1">

                    </div>
                </div>
            </div>
        </div>
        <div style=" height:600px; overflow:auto; ">
        <table class="table">
        <thead class="thead-dark">
        <tr>
            <th scope="col">Date</th>
            <th scope="col">PLZ</th>
            <th scope="col">New Cases</th>
            <th scope="col">Population</th>
        </tr>
        </thead>
        <tbody id="table-content">
        </tbody>
        </table>
    </div>
        </div>
